(6395, 1, 3, '', 'SK PPID Pembantu', 'Kini, tidak semua dokumen dapat menjadi bukti di Pengadilan Pajak.', '<p><img alt=\"\" class=\"mbr-figure__img\" src=\"assets/images/old_images/23b.jpg\" /> <img alt=\"\" class=\"mbr-figure__img\" src=\"assets/images/old_images/23c.jpg\" /> <img alt=\"\" class=\"mbr-figure__img\" src=\"assets/images/old_images/23d.jpg\" /> <img alt=\"\" class=\"mbr-figure__img\" src=\"assets/images/old_images/23e.jpg\" /></p>\r\n', 'awwa@dannydarussalam.com', '', 'HEADLINE', 0, '', '1809181247334.jpg', '', 1, '2016-05-31 18:28:00', 410, 'bea masuk, keberatan dan banding bea masuk, dokumen bukti', '', 0, NULL, NULL),
(6399, 1, 1, '', 'Seputar PPID Provinsi Jawa Timur', 'Diperlukan konsensus yang lebih kuat untuk mengakomodasi kebutuhan DJP dan kepentingan perbankan.', '<p>Undang Undang No 14 Tahun 2008 tentang Keterbukaan Informasi Publik (KIP) mengamanatkan, setiap Badan Publik Pemerintah maupun Badan Publik Non Pemerintah mempunyai kewajiban untuk menyediakan Informasi Publik yang berada di bawah kewenangannya kepada masyarakat dengan cepat, aktual, tepat waktu, biaya ringan dan cara sederhana.</p>\r\n\r\n<p>Sisi lain Undang Undang Keterbukaan Informasi Publik, menuntut kinerja Badan Publik yang transparan, efektif, efesien dan akuntabel. Oleh karena itu pelayanan informasi publik harus mendapat perhatian yang serius bagi kita semua sebagai Badan Publik penyedia informasi, dengan meningkatkan pengelolaan informasi yang berkualitas serta memberikan pelayanan dan menyediakan informasi publik yang mudah diakses oleh masyarakat.</p>\r\n\r\n<p>Untuk tujuan inilah setiap Badan Publik wajib menunjuk Pejabat Pengelola Informasi dan Dokumentasi (PPID), yang tugas pokok dan fungsinya adalah bertanggungjawab di bidang penyimpanan, pendokumentasian, penyediaan dan pelayanan informasi.</p>\r\n\r\n<p>Di tingkat Provinsi Jawa Timur, PPID ditetapkan dengan Surat Keputusan Gubernur Jawa Timur dan untuk Badan Publik SKPD di lingkungan Pemerintah Provinsi Jawa Timur sebagai PPID Pembantu/SKPD ditetapkan dengan surat Keputusan Kepala Badan Publik/SKPD.</p>\r\n\r\n<p>Demikian juga di tingkat Kabupaten dan Kota di Jawa Timur, PPID Kabupaten/Kota ditetapkan dengan Surat Keputusan Bupati atau Walikota, sedang Badan Publik/SKPD di lingkungan Pemerintah Kabupaten atau Kota sebagai PPID Pembantu/SKPD ditetapkan dengan Surat Keputusan Kepala Badan Publik /SKPD. 2</p>\r\n', '', '', 'REGULAR', 0, '', '1809181235262.jpg', '', 1, '2016-06-08 06:07:00', 2832, 'kerahasiaan bank, keterbukaan data, Ditjen Pajak', '', 0, NULL, NULL),
(6400, 4, 27, '', 'Wapres Anugerahkan Penghargaan Keterbukaan Informasi Publik', 'Hati-hati. Kesalahan pengukuran akan menghasilkan kesimpulan yang menyesatkan.', '<p>Wakil Presiden Boediono menganugerahkan penghargaan kepada badan publik yang memberikan layanan informasi terbaik, baik di tingkat pusat (kementerian dan lembaga) maupun provinsi di Istana Wakil Presiden, Jakarta, Jumat.</p>\r\n\r\n<p>Pemberian penghargaan dilakukan seiring dengan hariHak untuk Tahu Internasional (International Right to Know Day) yang diperingati setiap 28 September.</p>\r\n\r\n<p>Hari Hak untuk Tahu Internasional telah diperingati sejak 10 tahun lalu di dunia sedangkan di Indonesia peringatan baru dijalankan dua tahun ini, setelah UU no 14/2008 tentang Keterbukaan Informasi Publik berlaku secara efektif pada 2010.</p>\r\n\r\n<p>Penghargaan tersebut diberikan atas dua kategori informasi yang wajib diumumkan dan pelayanan informasi yang tersedia setiap saat.</p>\r\n\r\n<p>Untuk kategori pertama badan publik tingkat pusat, dimumkan 10 kementerian dan lembaga terbaik.</p>\r\n\r\n<p>Ke-10 kementerian lembaga tersebut diurutan pertama Kementerian Perindustrian, diikuti Kementerian Sekretaris Negara dan Badan Kependudukan dan Keluarga Berencana Nasional mendapat urutan ke-2.</p>\r\n\r\n<p>Di urutan ketiga Badan Tenaga Atom Nasional (BATAN), diikuti oleh Badan Pemeriksa Keuangan, Badan Pengawasan Keuangan dan Pembangunan (BPKP) dan Kementerian Koordiantor Perekonomian.</p>\r\n\r\n<p>Kementerian Kehutanan, Mahkamah Konstitusi, Kementerian Komunikasi dan Informasi, Kementerian Kesehatan, Kementerian Keuangan dan Pekerjaan Umum.</p>\r\n\r\n<p>Sedangkan untuk kategori pelayanan informasi yang tersedia, urutan pertama diperoleh Kementerian Sekretaris Negara yang diikuti BKPK dan BATAN.</p>\r\n\r\n<p>Untuk tingkat provinsi, kategori informasi yang wajib diumumkan, peringkat pertama diperolah Provinsi Jawa barat, diikuti DKI Jakarta, Sumatera Utara, Daerah Istimewa Yogyakarta.</p>\r\n\r\n<p>Kalimantan Timur, Nusa Tenggara Barat, Sumatera Selatan dan Jawa Timur, Lampung, Jawa Tengah dan Riau serta Kalimantan Tengah.</p>\r\n\r\n<p>Sedangkan untuk kategori pelayanan penyediaan informasi urutan pertama diperoleh Provinsi Jawa Timur, diikuti Jawa Barat dan Lampung.</p>\r\n\r\n<p>Wakil Presiden dalam kesempatan tersebut mengucapkan selamat kepada Kementerian dan Lembaga serta Provinsi yang memperoleh penghargaan tersebut.</p>\r\n\r\n<p>&ldquo;Saya mengharapkan pelayanan publik dilaksanakan sebaik-baiknya, akuntabel dan berdasarkan peraturan yang berlaku,&rdquo; kata Wakil Presiden.</p>\r\n\r\n<p>(Sumber: AntaraNews.com; M041/R007; &nbsp;Editor: Ruslan Burhani)</p>\r\n', '', '', 'HEADLINE', 0, '', '1809181231561.jpg', '<p><em>(Sumber: AntaraNews.com;&nbsp;M041/R007; &nbsp;Editor: Ruslan Burhani)</em></p>\r\n', 1, '2016-06-10 06:33:00', 3146, 'mengukur PPN, rasio PPN, penerimaan PPN', '', 0, NULL, NULL),
(6401, 1, 2, '', 'Kelembagaan PPID ', 'Tak semua kegiatan seorang artis bisa didefinisikan sebagai \'kegiatan keartisan\'.', '<p><strong>Tugas Dan Fungsi PPID SKPD/Pembantu</strong></p>\r\n\r\n<p><strong>Tugas:</strong></p>\r\n\r\n<p>Merencanakan, mengorganisasikan, melaksanakan, mengawasi dan mengevaluasi pelaksanaan kegiatan pengelolaan dan pelayanan informasi di lingkungan satuan kerja</p>\r\n\r\n<p><strong>Fungsi:</strong></p>\r\n\r\n<p>1) Mengelola dan melayani Informasi publik serta dokumentasi di satuan kerjanya.</p>\r\n\r\n<p>2) Pengolahan, penataan, data penyimpanan dan/atau informasi publik yang diperoleh di satuan kerjanya;</p>\r\n\r\n<p>3) Penyeleksian dan pengujian data dan informasi publik yang termasuk kategori dikecualikan dari informasi yang dibuka untuk publik yang ditetapkan oleh pejabat yang berwenang;</p>\r\n\r\n<p>4) Pengujian aksesibilitas atas suatu informasi publik;</p>\r\n\r\n<p>5) Penyelesaian sengketa pelayanan informasi;</p>\r\n\r\n<p>6) Pelaksanaan koordinasi antar bidang dalam pengelolaan dan pelayanan informasi publik serta dokumentasi.</p>\r\n', '', '', 'HEADLINE', 0, '', '1809181239013.jpg', '', 1, '2016-06-06 19:22:00', 841, 'natalia glebova, pajak iklan, bedah kasus, P3B, pajak internasional', '', 0, NULL, NULL),
(6403, 1, 6, '', 'SOP Pengajuan Keberatan', 'Dengan lompatan ini, target penerimaan pajak Kediri akan dinaikkan di APBDP 2016.', '<p><img src=\"assets/images/old_images/26a.jpg\" /></p>\r\n', '', '', 'HEADLINE', 0, '', '1809180117489.jpg', '', 1, '2016-05-10 19:25:00', 350, 'Kediri, penerimaan pajak, target PAD', '', 0, NULL, NULL),
(6404, 1, 5, '', 'SOP Pelayanan Informasi', 'Pemprov Banten menambah fasilitas ini untuk mengamankan target penerimaan PAD.', '<p><img src=\"assets/images/old_images/25a.jpg\" /></p>\r\n', '', '', 'HEADLINE', 0, '', '1809180113568.jpg', '', 1, '2016-05-11 19:27:00', 439, 'Rano Karno, PAD Banten, gerai samsat', '', 0, NULL, NULL),
(6405, 2, 8, '', 'Permohonan Informasi datang langsung', 'Fasilitas baru ini diharapkan dapat menaikkan tingkat kepatuhan wajib pajak.', '<p><br />\r\n<strong>MEKANISME PERMOHONAN INFORMASI PUBLIK</strong></p>\r\n\r\n<ol>\r\n	<li>Pemohon informasi datang ke desk layanan informasi mengisi formulir permintaan informasi denganmelampirkan foto copy KTP pemohon dan pengguna informasi, bagi lembaga publik/ormasdilengkapi foto copy akta pendirian, surat keterangan terdaftar di Bakesbangpol Provinsi JawaTimur/setempat, surat keterangan domisili lembaga publik/ormas. &nbsp; &nbsp;&nbsp;</li>\r\n	<li>Maksud dan tujuan permintaan informasi harus jelas penggunaannnya</li>\r\n	<li>Petugas memberi &nbsp;tanda bukti penerimaan permintaan &nbsp;informasi publik. kepada pemohon informasipublik.</li>\r\n	<li>Petugas memproses permintaan pemohon informasi publik sesuai dengan formulir permintaaninformasi publik yang telah ditandatangani oleh pemohon informasi publik.</li>\r\n	<li>Petugas menyerahkan informasi sesuai dengan yang diminta oleh pemohon/pengguna informasi. Jikainformasi yang diminta masuk dalam kategori dikecualikan, PPID menyampaikan alasan sesuaidengan keterangan perundangan yang berlaku.</li>\r\n	<li>Petugas memberikan Tanda bukti Penyerahan informasi Publik kepada pengguna informasi &nbsp;publik.</li>\r\n	<li>Membukukan dan mencatat</li>\r\n</ol>\r\n\r\n<p><strong>JANGKA WAKTU PENYELESAIAN</strong></p>\r\n\r\n<ol>\r\n	<li>&nbsp;Proses penyelesaian untuk memenuhi permintaan pemohon informasi publik dilakukan setelahpemohon informasi memenuhi persyaratan yang telah ditentukan.</li>\r\n	<li>Waktu penyelesaian dilaksanakan paling lambat 10 (sepuluh ) hari sejak diterima permintaan PejabatPengelola Informasi dan Dokumentasi ( PPID) akan menyampaikan pemberitahuan yang berisikaninformasi yang diminta berada dibawah penguasaannya atau tidak. &nbsp;Dan PPID dapat memperpanjangwaktu paling lambat 7 ( tujuh) hari kerja.</li>\r\n	<li>Penyampaian/pendistribusian/penyerahan informasi publik kepada pemohon informasi publikdilakukan secara langsung, &nbsp;dengan menandatangani berita acara penerimaan informasi publik.</li>\r\n	<li>Jika permohonan informasi diterima, maka dalam surat pemberitahuan juga dicantumkan materiinformasi yang diberikan, format informasi, apakah dalam bentuk softcopy atau &nbsp; &nbsp; &nbsp; data tertulis. Apabiladibutuhkan untuk keperluan penggandaan menjadi tanggung jawab atau beban pemohon informasi.Bila permintaan &nbsp;informasi ditolak, maka dalam surat pemberitahuan dicantumkan alasan penolakan &nbsp;berdasarkan UU KIP</li>\r\n</ol>\r\n\r\n<p><strong>BIAYA/TARIF</strong></p>\r\n\r\n<p>Pejabat Pengelola Informasi dan Dokumentasi menyediakan informasi publik secara gratis (tidak dipungut biaya), edangkan untuk penggandaan, pemohon/pengguna informasi public dapat melakukan penggandaan/fotocopy sendiri di sekitar gedung Dinas Kominfo Prov Jatim atau biaya penggandaan ditanggung oleh pemohon informasi.</p>\r\n', 'awwa@dannydarussalam.com', '', 'HEADLINE', 0, '', '18091801201710.jpg', '', 1, '2016-05-09 19:28:00', 354, 'kalkulator pajak, India, kepatuhan wajib pajak', '', 0, NULL, NULL),
