INSERT INTO `tbl_publication` (`ID`, `UPPERDECK`, `TITLE`, `CONTENT`, `RELEASE_DATE`, `PUBLISH_TIMESTAMP`, `STATUS`, `IMAGE`, `PDF`, `HIT`, `DOWNLOADED`) VALUES
(3, 'BUKU DIGITAL', 'Perjanjian Penghindaran Pajak Berganda', '<div class=\"publicreview\">\r\n<div class=\"preambule\">\r\n<div class=\"publisherinfo\">\r\n<p>&nbsp;</p>\r\n<div style=\"font-size: 20px; background: red; text-align: center; margin-top: -25px; margin-bottom: -15px; padding: 5px; color: #fff;\"><strong>GRATIS!</strong></div>\r\n<p>&nbsp;</p>\r\n<p>Buku ini terdiri dari 28 bab yang membahas tentang panduan, interpretasi, dan aplikasi perjanjian penghindaran pajak berganda (P3B). Pembahasan buku ini dilakukan secara komprehensif dan sistematis, yang dimulai dari pembahasan mengenai konsep dasar pajak internasional, perkembangan model P3B, penerapan P3B, hingga interpretasi pasal demi pasal yang terdapat dalam model P3B. Setiap pembahasan juga dilengkapi dengan informasi perkembangan terkini yang terjadi dalam P3B serta pembahasan terkait dengan Rencana Aksi BEPS.</p>\r\n<p>Buku ini ditulis oleh penulis yang mempunyai kompetensi, pengalaman, sertifikasi internasional, dan pendidikan di bidang pajak internasional dari institusi dan universitas ternama di dunia. Buku ini dapat dijadikan referensi bagi kalangan bisnis, otoritas pajak, pengadilan pajak, pengambil kebijakan fiskal, konsultan dan praktisi, serta kalangan akademisi.</p>\r\n<p>Info lebih lanjut hubungi: cs@ddtc.co.id</p>\r\n</div>\r\n</div>\r\n</div>', '2017-05-15', '2017-05-09 14:57:37', 1, '3-abc345.jpg', '', 63919, 3545);
